import React, {Component} from "react";

class AddBook extends Component {

    constructor(){
        super();


    }


    render() {
        return (
            <div>
                <form>
                    <div style={{padding:"90px"}}>
                        <div className="form-group">
                            <label htmlFor="inputTitle">Book Title</label>
                            <input type="title" name="title" className="form-control" id="inputTitle" placeholder="Enter Book Title"/>
                        </div>
                        <div className="form-group">
                            <label htmlFor="inputNumber">Book Number</label>
                            <input type="number" name="number" className="form-control" id="inputNumber" placeholder="Enter Book Number"/>
                        </div>
                        <input type="submit" className="btn btn-primary mt-4" />
                    </div>
                </form>
            </div>
        )
    }
}

export default AddBook;
